import{_ as l,o as i,c as p,e}from"./app.45b169d5.js";const o={},d=e('<h1 id="\u7B2C\u4E94\u7AE0-\u4E2D\u56FD\u9769\u547D\u7684\u65B0\u9053\u8DEF" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E94\u7AE0-\u4E2D\u56FD\u9769\u547D\u7684\u65B0\u9053\u8DEF" aria-hidden="true">#</a> \u7B2C\u4E94\u7AE0-\u4E2D\u56FD\u9769\u547D\u7684\u65B0\u9053\u8DEF</h1><h2 id="\u4E2D\u56FD\u5171\u4EA7\u515A\u5BF9\u9769\u547D\u65B0\u9053\u8DEF\u7684\u63A2\u7D22" tabindex="-1"><a class="header-anchor" href="#\u4E2D\u56FD\u5171\u4EA7\u515A\u5BF9\u9769\u547D\u65B0\u9053\u8DEF\u7684\u63A2\u7D22" aria-hidden="true">#</a> \u4E2D\u56FD\u5171\u4EA7\u515A\u5BF9\u9769\u547D\u65B0\u9053\u8DEF\u7684\u63A2\u7D22</h2><h3 id="\u56FD\u6C11\u515A\u5728\u5168\u56FD\u7EDF\u6CBB\u7684\u5EFA\u7ACB" tabindex="-1"><a class="header-anchor" href="#\u56FD\u6C11\u515A\u5728\u5168\u56FD\u7EDF\u6CBB\u7684\u5EFA\u7ACB" aria-hidden="true">#</a> \u56FD\u6C11\u515A\u5728\u5168\u56FD\u7EDF\u6CBB\u7684\u5EFA\u7ACB</h3><ul><li><p>\u201C\u56DB\u4E00\u4E8C\u201D\u653F\u53D8\u540E\uFF0C\u848B\u4ECB\u77F3\u4E8E==1927\u5E744\u670818\u65E5==\u5BA3\u544A\u5357\u4EAC\u56FD\u6C11\u653F\u5E9C\u6210\u7ACB\uFF0C\u53F2\u79F0==\u201C\u5B81\u3001\u6C49\u5408\u6D41\u201D==</p></li><li><p>==1928\u5E744\u6708==\u5F00\u59CB<strong>\u7B2C\u4E8C\u6B21\u5317\u4F10\u6218\u4E89</strong></p></li><li><p>==1928\u5E7412\u670829\u65E5==\u5F20\u5B66\u826F\u4ECE\u4E1C\u5317\u53D1\u51FA\u901A\u544A\uFF0C \u5BA3\u5E03\u201C\u9075\u5B88\u4E09\u6C11\u4E3B\u4E49\uFF0C\u670D\u4ECE\u56FD\u6C11\u653F\u5E9C\uFF0C\u6539\u6613\u65D7\u5E1C\u201D\uFF0C \u56FD\u6C11\u515A\u5728\u5168\u56FD\u8303\u56F4\u5185\u5EFA\u7ACB\u4E86\u81EA\u5DF1\u7684\u7EDF\u6CBB</p></li><li><p>\u56FD\u6C11\u515A\u653F\u6743\u7EDF\u6CBB\u7684\u6027\u8D28</p><ul><li>\u662F\u4E00\u4E2A\u7531==\u4EE3\u8868\u5730\u4E3B\u9636\u7EA7\u3001 \u4E70\u529E\u6027\u7684\u5927\u8D44\u4EA7\u9636\u7EA7\u5229\u76CA==\u7684\u53CD\u52A8\u96C6\u56E2\u6240\u63A7\u5236\u7684\u653F\u515A\u3002 \uFF08\u4E0E\u5317\u6D0B\u519B\u9600\u7684\u7EDF\u6CBB\u6CA1\u6709\u672C\u8D28\u533A\u522B\uFF09</li></ul></li><li><p>\u56FD\u6C11\u515A\u600E\u6837\u5B9E\u884C==\u4E00\u515A\u4E13\u653F==\u7684\u519B\u4E8B\u72EC\u88C1\u7EDF\u6CBB\uFF1F</p><ul><li><p>\u5EFA\u7ACB<strong>\u5E9E\u5927\u7684\u519B\u961F\u548C\u5168\u56FD\u7279\u52A1\u7CFB\u7EDF</strong></p></li><li><p>\u7981\u6B62<strong>\u9769\u547D\u6D3B\u52A8</strong>\uFF0C \u5927\u529B\u63A8\u884C<strong>\u4FDD\u7532\u5236\u5EA6</strong>\u4EE5\u63A7\u5236\u4EBA\u6C11</p></li><li><p>\u5265\u593A<strong>\u4EBA\u6C11\u7684\u8A00\u8BBA\u548C\u51FA\u7248\u81EA\u7531</strong>\uFF0C \u5389\u884C<strong>\u6587\u5316\u4E13\u5236\u4E3B\u4E49</strong></p></li></ul></li></ul><h3 id="\u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u5174\u8D77" tabindex="-1"><a class="header-anchor" href="#\u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u5174\u8D77" aria-hidden="true">#</a> \u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u5174\u8D77</h3><ul><li><p><strong>\u5927\u9769\u547D\u5931\u8D25\u540E\u7684\u8270\u96BE\u73AF\u5883</strong><em>1927\u5E74\u5927\u9769\u547D\u5931\u8D25\u540E\uFF0C\u4E2D\u56FD\u9769\u547D\u5F62\u52BF\u8F6C\u5165\u4F4E\u6F6E\uFF0C \u5E74\u8F7B\u7684\u4E2D\u56FD\u5171\u4EA7\u515A\u9762\u4E34\u7740\u6210\u7ACB\u540E\u4ECE\u672A\u9047\u5230\u7684\u4E25\u5CFB\u8003\u9A8C</em></p><ul><li><p>\u4E2D\u56FD\u5171\u4EA7\u515A\u53CA\u5176\u9886\u5BFC\u7684\u9769\u547D\u8FD0\u52A8\u906D\u5230\u56FD\u6C11\u515A\u7684\u6B8B\u9177\u9547\u538B\uFF0C \u53CD\u9769\u547D\u529B\u91CF\u8FC7\u4E8E\u5F3A\u5927</p></li><li><p>\u5728\u9ED1\u6697\u7684\u4E2D\u56FD\uFF0C\u5171\u4EA7\u515A\u72EC\u7ACB\u9AD8\u4E3E\u53CD\u5E1D\u53CD\u5C01\u5EFA\u7684 \u9769\u547D\u65D7\u5E1C</p></li></ul></li><li><p><strong>\u5F00\u5C55\u6B66\u88C5\u53CD\u6297\u56FD\u6C11\u515A\u53CD\u52A8\u7EDF\u6CBB\u7684\u6597\u4E89</strong></p><ul><li><p>==1927\u5E747\u6708\u4E2D\u65EC==\uFF0C\u4E2D\u5171\u4E2D\u592E\u4E34\u65F6\u653F\u6CBB\u5C40 \u5E38\u59D4\u4F1A\u51B3\u5B9A\u4E86\u4E09\u4EF6\u5927\u4E8B</p><ul><li><p>\u5C06\u515A\u6240\u638C\u63E1\u548C\u5F71\u54CD\u7684\u90E8\u961F\u5411==\u5357\u660C==\u96C6\u4E2D\uFF0C\u51C6\u5907\u8D77\u4E49</p></li><li><p>\u7EC4\u7EC7\u6E58\u9102\u8D63\u7CA4\u56DB\u7701\u519C\u6C11\uFF0C\u5728\u79CB\u6536\u5B63\u8282\u4E3E\u884C\u66B4\u52A8\uFF08\u53F2\u79F0==\u201C\u79CB\u6536\u8D77\u4E49\u201D==\uFF09</p></li><li><p>\u53EC\u96C6\u4E2D\u592E\u4F1A\u8BAE\uFF0C\u8BA8\u8BBA\u548C\u51B3\u5B9A\u65B0\u65F6\u671F\u7684\u65B9\u9488\u548C\u653F\u7B56</p></li></ul></li><li><p>==1927\u5E748\u67081\u65E5==\uFF0C\u4EE5\u5468\u6069\u6765\u4E3A\u4E66\u8BB0\u7684\u524D\u654C\u59D4\u5458\u4F1A\u9886\u5BFC\u4E0B\uFF0C \u8D3A\u9F99\u3001\u53F6\u633A\u3001\u6731\u5FB7\u3001\u5218\u4F2F\u627F\uFF0C\u2728<code>\u5728\u5357\u660C\u6253\u54CD\u4E86\u6B66\u88C5\u53CD\u6297\u56FD\u6C11\u515A\u53CD\u52A8\u6D3E\u7684\u7B2C\u4E00\u67AA\u3002\u8FD9\u662F\u4E2D\u56FD\u5171\u4EA7\u515A\u72EC\u7ACB\u9886\u5BFC\u9769\u547D\u6218\u4E89\u3001\u521B\u5EFA\u4EBA\u6C11\u519B</code><code>\u961F\u548C\u6B66\u88C5\u593A\u53D6\u653F\u6743\u7684\u5F00\u7AEF</code>\u2728</p></li><li><p>\u2728==1927\u5E748\u67087\u65E5==\uFF0C\u4E2D\u5171\u4E2D\u592E\u5728==\u6C49\u53E3==\u53EC\u5F00==\u516B\u4E03\u4F1A\u8BAE==\uFF0C\u786E\u5B9A\u4E86<code>\u571F\u5730\u9769\u547D\u4E0E\u6B66\u88C5\u8D77\u4E49</code>\u7684\u65B9\u9488</p><ul><li>\u610F\u4E49\uFF1A <code>\u516B\u4E03\u4F1A\u8BAE\u7ED9\u6B63\u5904\u5728\u601D\u60F3\u6DF7\u4E71\u548C\u7EC4\u7EC7\u6DA3\u6563\u4E2D\u7684\u4E2D\u56FD\u5171\u4EA7\u515A\u6307</code><code>\u660E\u4E86\u65B0\u7684\u51FA\u8DEF\uFF0C\u8FD9\u662F\u7531\u5927\u9769\u547D\u5931\u8D25\u5230\u571F\u5730\u9769\u547D\u6218\u4E89\u5174\u8D77\u7684</code><code>\u5386\u53F2\u6027\u8F6C\u53D8</code></li></ul></li><li><p>==1927\u5E749\u67089\u65E5==\uFF0C\u6BDB\u6CFD\u4E1C\u7B49\u9886\u5BFC\u7684\u6E58\u8D63\u8FB9\u754C==\u79CB\u6536\u8D77\u4E49==\u7206\u53D1\u3002</p></li><li><p>==1927\u5E749\u670829\u65E5==\uFF0C\u6BDB\u6CFD\u4E1C\u9886\u5BFC\u8D77\u4E49\u519B\u5728\u6C5F\u897F\u6C38\u65B0\u53BF\u4E09\u6E7E\u6751\u8FDB\u884C\u4E86==\u4E09\u6E7E\u6539\u7F16==</p><ul><li><p>\u4E09\u6E7E\u6539\u7F16<code>\u4ECE\u7EC4\u7EC7\u4E0A\u786E\u7ACB\u4E86\u515A\u5BF9\u519B\u961F\u7684\u9886\u5BFC</code></p></li><li><p>\u4E09\u6E7E\u6539\u7F16<code>\u662F\u5EFA\u8BBE\u65E0\u4EA7\u9636\u7EA7\u9886\u5BFC\u7684\u65B0\u578B\u4EBA\u6C11\u519B\u961F\u7684\u91CD\u8981\u5F00\u7AEF</code></p></li></ul></li><li><p>==1927\u5E7410\u67087\u65E5==\u8D77\u4E49\u90E8\u961F\u62B5\u8FBE\u6C5F\u897F\u7701\u5B81\u5188\u53BF\u8305\u576A\uFF0C\u5F00\u59CB\u4E86\u521B\u5EFA<code>\u4E95\u5188\u5C71\u519C\u6751\u9769\u547D\u6839\u636E\u5730</code>\u7684\u6597\u4E89\u3002</p><ul><li>\u4ECE\u8FDB\u653B\u5927\u57CE\u5E02\u8F6C\u5230\u5411\u519C\u6751\u8FDB\u519B\uFF0C<code>\u8FD9\u662F\u4E2D\u56FD\u4EBA\u6C11</code><code>\u9769\u547D\u53F2\u4E0A\u5177\u6709\u51B3\u5B9A\u610F\u4E49\u7684\u65B0\u8D77\u70B9</code></li></ul></li><li><p>\u2764\uFE0F==\u5B9E\u8DF5\u8BC1\u660E\uFF1A\u9762\u5BF9\u56FD\u6C11\u515A\u65B0\u519B\u9600\u5728\u4E2D\u5FC3\u57CE\u5E02\u62E5\u6709\u5F3A\u5927\u6B66\u88C5\u7684\u5F62\u52BF\uFF0C== ==\u60F3\u901A\u8FC7\u57CE\u5E02\u6B66\u88C5\u8D77\u4E49\u6216\u653B\u5360\u5927\u57CE\u5E02\u6765\u593A\u53D6\u9769\u547D\u80DC\u5229\u662F\u4E0D\u53EF\u80FD\u7684==\u2764\uFE0F</p></li></ul></li></ul><h3 id="\u519C\u6751\u5305\u56F4\u57CE\u5E02-\u6B66\u88C5\u593A\u53D6\u653F\u6743-\u9053\u8DEF\u7684\u5F00\u8F9F" tabindex="-1"><a class="header-anchor" href="#\u519C\u6751\u5305\u56F4\u57CE\u5E02-\u6B66\u88C5\u593A\u53D6\u653F\u6743-\u9053\u8DEF\u7684\u5F00\u8F9F" aria-hidden="true">#</a> ==\u519C\u6751\u5305\u56F4\u57CE\u5E02\uFF0C\u6B66\u88C5\u593A\u53D6\u653F\u6743==\u9053\u8DEF\u7684\u5F00\u8F9F</h3><ul><li><p>\u5BF9\u4E2D\u56FD\u9769\u547D\u65B0\u9053\u8DEF\u7684\u63A2\u7D22</p><ul><li><p><strong>\u63D0\u51FA\u80CC\u666F</strong></p><ul><li><p>1927\u5E7411\u6708\uFF0C\u6210\u7ACB\u6E58\u8D63\u8FB9\u754C\u7B2C\u4E00\u4E2A\u7EA2\u8272\u653F\u6743\u2014\u2014<code>\u8336\u9675\u53BF\u5DE5\u519C\u5175\u653F\u5E9C</code></p></li><li><p>1928\u5E742\u6708\u4E2D\u65EC\uFF0C\u6253\u8D25\u6C5F\u897F\u56FD\u6C11\u515A\u519B\u961F\u5BF9\u4E95\u5188\u5C71\u5730\u533A\u7684\u8FDB\u653B\u3002\u81F3\u6B64\uFF0C\u4E95\u5188\u5C71\u6839\u636E\u5730\u521D\u6B65\u5730\u5EFA\u7ACB\u4E0B\u6765</p></li></ul></li><li><p>\u2728==\u610F\u4E49==</p><ul><li><p>\u4E95\u5188\u5C71\u6839\u636E\u5730\u7684\u5EFA\u7ACB\uFF0C\u70B9\u71C3\u4E86\u5DE5\u519C\u6B66\u88C5\u5272\u636E\u7684\u661F\u661F\u4E4B\u706B\uFF0C\u4E3A\u4E2D\u56FD\u9769\u547D\u5F00\u8F9F\u51FA\u4E86 <code>\u519C\u6751\u5305\u56F4\u57CE\u5E02\u3001\u6B66\u88C5\u593A\u53D6\u653F\u6743</code>\u8FD9\u6837\u4E00\u6761\u524D\u4EBA\u6CA1\u6709\u8D70\u8FC7\u7684\u6B63\u786E\u9053\u8DEF\u3002</p></li><li><p>\u5927\u9769\u547D\u5931\u8D25\u540E\uFF0C\u4E2D\u56FD\u5171\u4EA7\u515A\u4EBA\u6B63\u662F\u6CBF\u7740\u8FD9\u6837\u72EC\u7279\u7684\u9053\u8DEF\uFF0C\u5F15\u5BFC\u4E2D\u56FD\u9769\u547D\u8D70\u5411\u590D\u5174\u5E76\u9010\u6B65\u8D62\u5F97\u80DC\u5229\u7684\u3002</p></li></ul></li><li><p>\u63D0\u51FA\u8FC7\u7A0B\uFF1A</p><ul><li><p>1928\u5E746\u6708\uFF0C\u5728\u82CF\u8054\u4E3E\u884C\u7684\u4E2D\u56FD\u5171\u4EA7\u515A\u7B2C\u516D\u6B21\u5168\u56FD\u4EE3\u8868\u5927\u4F1A</p><ul><li><p>\u7EE7\u7EED\u628A\u57CE\u5E02\u5DE5\u4F5C\u7684\u590D\u5174\u89C6\u4E3A\u9769\u547D\u9AD8\u6F6E\u5230\u6765\u7684\u51B3\u5B9A\u6761\u4EF6</p></li><li><p>\u80AF\u5B9A\u4E86\u519C\u6751\u6839\u636E\u5730\u548C\u7EA2\u519B\u662F\u51B3\u5B9A\u9769\u547D\u65B0\u9AD8\u6F6E\u7684\u66F4\u5927\u7684 \u53D1\u5C55\u57FA\u7840\u548C\u91CD\u8981\u529B\u91CF</p></li><li><p>\u786E\u5B9A\u4EE5<code>\u4E89\u53D6\u7FA4\u4F17</code>\u4E3A\u515A\u7684\u9996\u8981\u4EFB\u52A1\uFF0C\u628A\u201C\u5DE6\u201D\u503E\u4F5C\u4E3A \u4E3B\u8981\u5371\u9669\u6765\u53CD\u5BF9\u3002</p></li></ul></li><li><p>1929\u5E749\u6708\uFF0C\u4E2D\u5171\u4E2D\u592E\u7ED9\u7EA2\u56DB\u519B\u524D\u59D4\u7684\u6307\u793A\u4FE1\u4E2D\u6307\u51FA ==\u201C\u5148\u6709\u519C\u6751\u7EA2\u519B\uFF0C\u540E\u6709\u57CE\u5E02\u653F\u6743\uFF0C\u8FD9\u662F\u4E2D\u56FD\u9769\u547D\u7684\u7279 \u5F81\uFF0C\u8FD9\u662F\u4E2D\u56FD\u7ECF\u6D4E\u57FA\u7840\u7684\u4EA7\u7269\u201D==</p></li><li><p>1929\u5E7412\u6708\uFF0C\u53E4\u7530\u4F1A\u8BAE\u53EC\u5F00</p><ul><li><p>\u5185\u5BB9</p><ul><li><p>\u6700\u91CD\u8981\u7684\u662F\uFF0C==\u5173\u4E8E\u7EA0\u6B63\u515A\u5185\u9519\u8BEF\u601D\u60F3\u7684\u51B3\u8BAE\u6848\uFF0C\u786E\u7ACB\u4E86\u601D\u60F3\u5EFA\u515A\u3001\u653F\u6CBB\u5EFA\u519B\u539F\u5219==</p></li><li><p>\u9610\u8FF0\u4E86\u52A0\u5F3A\u515A\u7684\u601D\u60F3\u5EFA\u8BBE\u7684\u6781\u7AEF\u91CD\u8981\u6027</p></li><li><p>\u89C4\u5B9A\u7EA2\u519B\u662F\u4E00\u4E2A\u6267\u884C\u9769\u547D\u7684\u653F\u6CBB\u4EFB\u52A1\u7684\u6B66\u88C5\u96C6\u56E2\uFF0C\u5FC5\u987B\u7EDD\u5BF9\u670D\u4ECE\u5171\u4EA7\u515A\u7684\u9886\u5BFC</p></li><li><p>\u7EA2\u519B\u5FC5\u987B\u62C5\u8D1F\u6253\u4ED7\u3001\u7B79\u6B3E\u548C\u505A\u7FA4\u4F17\u5DE5\u4F5C\u7684\u4EFB\u52A1</p></li></ul></li><li><p>\u610F\u4E49</p><ul><li><p>\u53E4\u7530\u4F1A\u8BAE\u662F<code>\u4E2D\u56FD\u5171\u4EA7\u515A\u548C\u7EA2\u519B\u5EFA\u8BBE\u7684\u7EB2\u9886\u6027\u6587\u732E\uFF0C\u662F\u515A\u548C\u4EBA\u6C11\u519B\u961F\u5EFA\u8BBE\u53F2\u4E0A\u7684\u91CD\u8981\u91CC\u7A0B\u7891</code></p></li><li><p>\u786E\u7ACB\u4E86\u9A6C\u514B\u601D\u4E3B\u4E49\u5EFA\u515A\u5EFA\u519B\u539F\u5219\uFF0C\u521B\u9020\u6027\u5730\u89E3\u51B3\u4E86\u5728\u519C\u6751\u73AF\u5883\u4E2D\u3001\u5728\u515A\u7EC4\u7EC7\u548C\u519B\u961F \u4EE5\u519C\u6C11\u4E3A\u4E3B\u8981\u6210\u5206\u7684\u6761\u4EF6\u4E0B\uFF0C==\u5982\u4F55\u4FDD\u6301\u515A\u7684\u65E0\u4EA7\u9636\u7EA7\u5148\u950B\u961F\u6027\u8D28\u548C\u5EFA\u8BBE\u515A\u9886\u5BFC\u7684\u65B0\u578B== ==\u4EBA\u6C11\u519B\u961F\u7684\u91CD\u5927\u95EE\u9898==</p></li></ul></li></ul></li></ul></li><li><p>\u6BDB\u6CFD\u4E1C\u540C\u5FD7\u505A\u51FA\u7684\u7406\u8BBA\u521B\u65B0</p><ul><li><p>\u6BDB\u6CFD\u4E1C\u4E0D\u4EC5==\u5728\u5B9E\u8DF5\u4E2D==\u9996\u5148\u628A\u6B66\u88C5\u6597\u4E89\u7684\u7ACB\u8DB3\u70B9\u653E\u5728\u519C\u6751\uFF0C\u9886\u5BFC\u5F00\u521B\u4E95\u5188\u5C71\u6839\u636E\u5730\uFF0C\u521B\u9020\u6027\u5730\u89E3\u51B3\u4E86 \u4E3A\u575A\u6301\u548C\u53D1\u5C55\u519C\u6751\u6839\u636E\u5730==\u6240\u5FC5\u987B\u89E3\u51B3\u7684\u4E00\u7CFB\u5217\u6839\u672C\u95EE\u9898==\uFF0C==\u4ECE\u7406\u8BBA\u4E0A==\u9010\u6B65\u5BF9\u4E2D\u56FD\u9769\u547D\u9053\u8DEF\u95EE\u9898\u4F5C\u51FA\u660E \u786E\u8BF4\u660E</p></li><li><p>1928\u5E7410\u6708\uFF0C11\u6708\uFF0C\u6BDB\u6CFD\u4E1C\u5199\u4E86<code>\u300A\u4E2D\u56FD\u7684\u7EA2\u8272\u653F\u6743\u4E3A\u4EC0\u4E48\u80FD\u591F\u5B58\u5728\uFF1F\u300B</code>\u548C<code>\u300A\u4E95\u5188\u5C71\u7684\u6597\u4E89\u300B</code>\uFF0C\u660E\u786E\u6307\u51FA \u4EE5\u519C\u4E1A\u4E3A\u4E3B\u8981\u7ECF\u6D4E\u7684\u4E2D\u56FD\u9769\u547D\uFF0C\u4EE5\u519B\u4E8B\u53D1\u5C55\u66B4\u52A8\uFF0C\u662F\u4E00\u79CD\u7279\u5F81\uFF1B \u6DF1\u523B\u8BBA\u8BC1\u4E86==\u7EA2\u8272\u653F\u6743\u80FD\u591F\u957F\u671F\u5B58 \u5728\u5E76\u53D1\u5C55\u7684\u4E3B\u5BA2\u89C2\u6761\u4EF6==\uFF0C\u63D0\u51FA\u4E86\u5DE5\u519C\u6B66\u88C5\u5272\u636E\u7684\u601D\u60F3\u3002</p><ul><li><p>\u6839\u672C\u539F\u56E0</p><ul><li>\u8FD1\u4EE3\u4E2D\u56FD\u653F\u6CBB\u7ECF\u6D4E\u53D1\u5C55\u4E0D\u5E73\u8861</li></ul></li><li><p>\u5BA2\u89C2\u6761\u4EF6</p><ul><li><p>\u826F\u597D\u7684\u7FA4\u4F17\u57FA\u7840</p></li><li><p>\u5411\u524D\u53D1\u5C55\u7684\u9769\u547D\u5F62\u52BF</p></li></ul></li><li><p>\u4E3B\u89C2\u6761\u4EF6</p><ul><li><p>\u4E2D\u56FD\u5171\u4EA7\u515A\u7684\u6B63\u786E\u9886\u5BFC</p></li><li><p>\u76F8\u5F53\u529B\u91CF\u7684\u6B63\u5F0F\u7EA2\u519B\u5B58\u5728</p></li></ul></li></ul></li><li><p>1930\u5E741\u6708\uFF0C\u6BDB\u6CFD\u4E1C\u5728<code>\u300A\u661F\u661F\u4E4B\u706B\uFF0C\u53EF\u4EE5\u71CE\u539F\u300B</code>\u4E00\u6587\u4E2D\u8FDB\u4E00\u6B65\u6307\u51FA\uFF1A==\u7EA2\u519B\u3001\u6E38\u51FB\u961F\u548C\u7EA2\u8272\u533A\u57DF\u7684\u5EFA\u7ACB \u548C\u53D1\u5C55==\uFF0C\u662F\u534A\u6B96\u6C11\u5730\u4E2D\u56FD\u5728\u65E0\u4EA7\u9636\u7EA7\u9886\u5BFC\u4E4B\u4E0B\u7684\u519C\u6C11\u6597\u4E89\u7684==\u6700\u9AD8\u5F62\u5F0F==\uFF0C\u548C\u534A\u6B96\u6C11\u5730\u519C\u6C11\u6597\u4E89\u53D1\u5C55\u7684 ==\u5FC5\u7136\u7ED3\u679C==\uFF0C\u5E76\u4E14\u65E0\u7591\u4E49\u5730\u662F\u4FC3\u8FDB\u5168\u56FD\u9769\u547D\u9AD8\u6F6E\u7684==\u6700\u91CD\u8981\u56E0\u7D20==\u3002</p></li><li><p>1930\u5E745\u6708\uFF0C\u6BDB\u6CFD\u4E1C\u5728\u300A\u53CD\u5BF9\u672C\u672C\u4E3B\u4E49\u300B\u4E2D\u6307\u51FA\u201C\u6CA1\u6709\u8C03\u67E5\uFF0C\u6CA1\u6709\u53D1\u8A00\u6743\u201D\u548C\u201C\u4E2D\u56FD\u9769\u547D\u6597\u4E89\u7684\u80DC\u5229 \u8981\u9760\u4E2D\u56FD\u540C\u5FD7\u4E86\u89E3\u4E2D\u56FD\u60C5\u51B5\u201D\u7684\u91CD\u8981\u601D\u60F3\uFF0C\u8868\u73B0\u4E86\u6BDB\u6CFD\u4E1C==\u5F00\u8F9F\u65B0\u9053\u8DEF\u3001\u521B\u9020\u65B0\u7406\u8BBA==\u7684\u9769\u547D\u9996\u521B\u7CBE\u795E\u3002</p></li></ul></li><li><p>\u515A\u5BF9\u519B\u961F\u7684\u7EDD\u5BF9\u9886\u5BFC</p><ul><li><p>\u610F\u4E49</p><ul><li><p>\u515A\u5BF9\u519B\u961F\u7684\u7EDD\u5BF9\u9886\u5BFC\u662F\u4EBA\u6C11\u519B\u961F\u6C38\u8FDC\u4E0D\u53D8\u7684\u519B\u9B42\uFF0C</p></li><li><p>\u662F\u4EBA\u6C11\u519B\u961F\u5B8C\u5168\u533A\u522B\u4E8E\u4E00\u5207\u65E7\u519B\u961F\u7684\u653F\u6CBB\u7279\u8D28\u548C\u6839\u672C\u4F18\u52BF</p></li><li><p>\u5BF9\u4E2D\u56FD\u9769\u547D\u65B0\u9053\u8DEF\u7684\u5F00\u8F9F\u548C\u575A\u6301\u5177\u6709\u91CD\u8981\u610F\u4E49</p></li></ul></li></ul></li></ul></li><li><p>\u53CD\u201C\u56F4\u527F\u201D\u6218\u4E89\u4E0E\u571F\u5730\u9769\u547D</p><ul><li><p><strong>\u53CD\u56F4\u527F\u8FC7\u7A0B\uFF1A</strong> 1930\u5E7410\u6708\u81F31932\u5E74\u5E95\uFF0C\u56FD\u6C11\u515A\u5171\u53D1\u52A8\u4E86\u56DB\u6B21\u201C\u56F4\u527F\u201D\uFF0C\u7EA2\u519B\u5728\u6BDB\u6CFD\u4E1C\u3001\u6731\u5FB7\u7B49\u6307\u6325\u4E0B\uFF0C\u8D2F\u5F7B==\u79EF\u6781\u9632\u5FA1== \u7684\u65B9\u9488\uFF0C\u5B9E\u884C\u4E00\u5957\u884C\u4E4B\u6709\u6548\u7684\u6218\u672F\uFF0C\u8FDE\u7EED\u7C89\u788E\u4E86\u56FD\u6C11\u515A\u519B\u961F\u7684\u56DB\u6B21\u56F4\u527F\u8BA1\u5212</p></li><li><p>\u571F\u5730\u9769\u547D\u7684<strong>\u5185\u5BB9</strong></p><ul><li><p>\u660E\u786E\u89C4\u5B9A\u519C\u6C11\u5DF2\u7ECF\u5206\u5F97\u7684\u7530\u5F52\u519C\u6C11\u4E2A\u4EBA\u79C1\u6709\uFF0C\u53EF\u4EE5\u81EA\u4E3B\u79DF\u501F\u4E70\u5356\uFF0C\u522B\u4EBA\u4E0D\u5F97\u4FB5\u72AF</p></li><li><p>\u575A\u5B9A\u4F9D\u9760\u8D2B\u519C\u3001\u96C7\u519C\uFF0C\u8054\u5408\u4E2D\u519C\uFF0C\u9650\u5236\u5BCC\u519C\uFF0C\u4FDD\u62A4\u4E2D\u5C0F\u5DE5\u5546\u4E1A\u8005\uFF0C\u6D88\u706D\u5730\u4E3B\u9636\u7EA7</p></li><li><p>\u4EE5\u4E61\u4E3A\u5355\u4F4D\uFF0C\u6309\u4EBA\u53E3\u5E73\u5206\u571F\u5730\uFF0C\u5728\u539F\u8015\u5730\u7684\u57FA\u7840\u4E0A\uFF0C\u5B9E\u884C\u62BD\u591A\u8865\u5C11\uFF0C\u62BD\u80A5\u8865\u7626</p></li></ul></li><li><p>\u571F\u5730\u9769\u547D\u7684<strong>\u610F\u4E49</strong></p><ul><li><p>\u8C03\u52A8\u4E86\u5E7F\u5927\u519C\u6C11\u53D1\u5C55\u751F\u4EA7\u548C\u53C2\u519B\u53C2\u6218\u7684\u79EF\u6781\u6027</p></li><li><p>\u5728\u5927\u9769\u547D\u5931\u8D25\u3001\u767D\u8272\u6050\u6016\u6781\u5176\u4E25\u91CD\u7684\u6761\u4EF6\u4E0B\uFF0C\u4E2D\u56FD\u9769\u547D\u4E4B\u6240\u4EE5\u80FD\u591F\u5F97\u5230\u575A\u6301\u548C\u53D1\u5C55\uFF0C ==\u6839\u672C\u539F\u56E0==\u5C31\u5728\u4E8E==\u56FD\u5171\u4EA7\u515A\u7D27\u7D27\u5730\u4F9D\u9760\u519C\u6C11\uFF0C\u9886\u5BFC\u519C\u6C11\u8FDB\u884C\u4E86\u571F\u5730\u5236\u5EA6\u7684\u9769\u547D==</p></li></ul></li></ul></li></ul><h2 id="\u4E2D\u56FD\u9769\u547D\u5728\u66F2\u6298\u4E2D\u8FDB\u884C" tabindex="-1"><a class="header-anchor" href="#\u4E2D\u56FD\u9769\u547D\u5728\u66F2\u6298\u4E2D\u8FDB\u884C" aria-hidden="true">#</a> \u4E2D\u56FD\u9769\u547D\u5728\u66F2\u6298\u4E2D\u8FDB\u884C</h2><h3 id="\u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u53D1\u5C55\u53CA\u5176\u632B\u6298" tabindex="-1"><a class="header-anchor" href="#\u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u53D1\u5C55\u53CA\u5176\u632B\u6298" aria-hidden="true">#</a> \u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u53D1\u5C55\u53CA\u5176\u632B\u6298</h3><ul><li><p>\u519C\u6751\u9769\u547D\u6839\u636E\u5730\u7684\u5EFA\u8BBE</p><ul><li><p>==1931\u5E7411\u6708==\uFF0C\u4E2D\u534E\u82CF\u7EF4\u57C3\u7B2C\u4E00\u6B21\u5168\u56FD\u4EE3\u8868\u5927\u4F1A\u5728\u6C5F\u897F\u745E\u91D1\u53EC\u5F00\u3002\u5927\u4F1A\u901A\u8FC7\u4E86\u300A\u4E2D\u534E\u82CF\u7EF4\u57C3\u5171\u548C\u56FD\u5BAA\u6CD5\u5927\u7EB2\u300B \u9009\u4E3E\u4EA7\u751F\u4E86\u4E2D\u534E\u82CF\u7EF4\u57C3\u5171\u548C\u56FD\u4E2D\u592E\u6267\u884C\u59D4\u5458\u4F1A\uFF0C==\u6210\u7ACB\u4E86\u4E2D\u534E\u82CF\u7EF4\u57C3\u5171\u548C\u56FD\u4E34\u65F6\u4E2D\u592E\u653F\u5E9C\uFF0C<code>\u6BDB\u6CFD\u4E1C</code>\u5F53\u9009\u4E3A\u4E3B\u5E2D==</p></li><li><p>\u82CF\u7EF4\u57C3\u653F\u5E9C\u7684\u6027\u8D28\uFF1A \u4E2D\u534E\u82CF\u7EF4\u57C3\u5171\u548C\u56FD\u662F\u4E2D\u56FD\u5386\u53F2\u4E0A\u7B2C\u4E00\u4E2A\u5168\u56FD\u6027\u7684\u5DE5\u519C\u6C11\u4E3B\u653F\u6743\uFF0C\u662F\u4E2D\u56FD\u5171\u4EA7\u515A\u5728\u5C40\u90E8\u5730\u533A\u6267\u653F\u7684\u91CD\u8981\u5C1D\u8BD5\u3002</p></li><li><p>\u82CF\u7EF4\u57C3\u653F\u5E9C\u653F\u6CBB\u4E3E\u63AA</p><ul><li><p>\u6CE8\u91CD\u53D1\u5C55\u6587\u5316\u6559\u80B2\u4E8B\u4E1A\uFF0C\u63D0\u9AD8\u5DE5\u519C\u7FA4\u4F17\u7684\u6587\u5316\u6C34\u5E73\u3002</p></li><li><p>\u91CD\u89C6\u5EC9\u653F\u5EFA\u8BBE\u548C\u53F8\u6CD5\u5EFA\u8BBE</p></li></ul></li></ul></li><li><p>\u571F\u5730\u9769\u547D\u6218\u4E89\u7684\u4E25\u91CD\u53D7\u632B</p><ul><li><p><strong>\u80CC\u666F</strong>\uFF1A \u201C\u5DE6\u201D\u503E\u9519\u8BEF\u5148\u540E\u4E09\u6B21\u5728\u515A\u4E2D\u592E\u9886\u5BFC\u673A\u5173\u53D6\u5F97\u4E86\u7EDF\u6CBB\u5730\u4F4D\uFF0C \u5C24\u5176\u662F\u4EE5\u738B\u660E\u4E3A\u4EE3\u8868\u7684\u201C\u5DE6\u201D\u503E\u6559\u6761\u4E3B\u4E49\u9519\u8BEF</p></li><li><p>\u5C61\u6B21\u51FA\u73B0\u201C\u5DE6\u201D\u503E\u9519\u8BEF\u7684\u539F\u56E0</p><ul><li><p>\u516B\u4E03\u4F1A\u8BAE\u540E\u515A\u5185\u4E00\u76F4\u5B58\u5728\u7740\u6D53\u539A\u7684\u201C\u5DE6\u201C\u503E\u60C5\u7EEA\u59CB\u7EC8\u6CA1\u6709\u5F97\u5230\u8BA4\u771F\u6E05\u7406</p></li><li><p>\u5171\u4EA7\u56FD\u9645\u5BF9\u4E2D\u56FD\u9769\u547D\u7684\u9519\u8BEF\u6307\u5BFC</p></li><li><p>\u4E3B\u8981\u5728\u4E8E<code>\u515A\u7684\u9A6C\u514B\u601D\u4E3B\u4E49\u7406\u8BBA\u51C6\u5907\u4E0D\u8DB3\uFF0C\u7F3A\u4E4F\u5B9E\u8DF5\u7ECF\u9A8C\uFF0C\u5BF9\u4E2D\u56FD\u7684\u5386\u53F2\u72B6\u51B5\u548C\u793E\u4F1A\u72B6\u51B5\u3001</code><code>\u4E2D\u56FD\u9769\u547D\u7684\u7279\u70B9\u3001\u4E2D\u56FD\u9769\u547D\u7684\u89C4\u5F8B\u4E0D\u751A\u4E86\u89E3\uFF0C\u4E0D\u5584\u4E8E\u628A\u9A6C\u514B\u601D\u5217\u5B81\u4E3B\u4E49\u4E0E\u4E2D\u56FD\u5B9E\u9645\u5168\u9762</code><code>\u5730\u3001\u6B63\u786E\u5730\u7ED3\u5408\u8D77\u6765\u3002</code></p></li></ul></li><li><p>\u5C61\u6B21\u201C\u5DE6\u201D\u503E\u4F7F\u5F97\u7EA2\u519B\u5728\u7B2C\u4E94\u6B21\u53CD\u201C\u56F4\u527F\u201D\u4F5C\u6218\u4E2D\u906D\u5230\u5931\u8D25\uFF0C \u4E0D\u5F97\u4E0D\u9000\u51FA\u5357\u65B9\u6839\u636E\u5730\u5B9E\u884C\u6218\u7565\u8F6C\u79FB\u2014\u2014==\u957F\u5F81==</p></li></ul></li><li><p>\u9075\u4E49\u4F1A\u8BAE\u5B9E\u73B0\u4F1F\u5927\u5386\u53F2\u8F6C\u6298</p><ul><li><p>\u957F\u5F81\u5F00\u59CB</p><ul><li><p>1934\u5E74\u4E0A\u65EC\uFF0C\u56FD\u6C11\u515A\u519B\u961F\u52A0\u7D27\u5BF9\u4E2D\u5171\u9769\u547D\u6839\u636E\u5730\u8179\u5730\u53D1\u52A8\u8FDB\u653B\uFF0C \u7EA2\u519B\u5DF2\u65E0\u5728\u539F\u5730\u626D\u8F6C\u6218\u5C40\u7684\u53EF\u80FD\uFF1B</p></li><li><p>10\u6708\uFF0C\u4E2D\u5171\u4E2D\u592E\uFF0C\u4E2D\u9769\u519B\u59D4\u7387\u4E2D\u5171\u7EA2\u519B\u5F00\u59CB\u957F\u5F81</p></li></ul></li><li><p>\u2728==\u9075\u4E49\u4F1A\u8BAE==</p><ul><li><p>\u65F6\u95F4\uFF1A 1935\u5E741\u670815\u65E5\u81F317\u65E5\uFF0C\u4E2D\u5171\u4E2D\u592E\u5728\u9075\u4E49\u53EC\u5F00\u4E86\u9075\u4E49\u4F1A\u8BAE</p></li><li><p>\u4F1A\u8BAE\u610F\u4E49</p><ul><li><p><code>\u9075\u4E49\u4F1A\u8BAE\u662F\u515A\u7684\u5386\u53F2\u4E0A\u4E00\u4E2A\u751F\u6B7B\u6538\u5173\u7684\u8F6C\u6298\u70B9</code></p></li><li><p>\u786E\u7ACB\u4E86\u6BDB\u6CFD\u4E1C\u5728\u515A\u4E2D\u592E\u548C\u7EA2\u519B\u7684\u9886\u5BFC\u5730\u4F4D\uFF0C \u5F00\u59CB\u786E\u7ACB\u4E86\u4EE5\u6BDB\u6CFD\u4E1C\u4E3A\u4E3B\u8981\u4EE3\u8868\u7684\u9A6C\u514B\u601D\u4E3B\u4E49\u6B63\u786E\u8DEF\u7EBF\u5728\u515A\u4E2D\u592E\u7684\u9886\u5BFC\u5730\u4F4D\uFF0C \u5F00\u59CB\u5F62\u6210\u4EE5\u6BDB\u6CFD\u4E1C\u540C\u5FD7\u4E3A\u6838\u5FC3\u7684\u7B2C\u4E00\u4EE3\u4E2D\u592E\u9886\u5BFC\u96C6\u4F53</p></li><li><p>\u9075\u4E49\u4F1A\u8BAE\u5728\u6700\u5371\u6025\u5173\u5934\u633D\u6551\u4E86\u515A\u3001\u633D\u6551\u4E86\u7EA2\u519B\u3001\u633D\u6551\u4E86\u4E2D\u56FD\u9769\u547D</p></li><li><p>\u5F00\u542F\u4E86\u4E2D\u56FD\u5171\u4EA7\u515A\u72EC\u7ACB\u81EA\u4E3B\u89E3\u51B3\u4E2D\u56FD\u9769\u547D\u5B9E\u9645\u95EE\u9898\u7684\u65B0\u9636\u6BB5</p></li></ul></li><li><p>\u4F1A\u8BAE\u9C9C\u660E\u7279\u70B9</p><ul><li>\u9075\u4E49\u4F1A\u8BAE\u7684\u9C9C\u660E\u7279\u70B9\u662F\u575A\u6301\u771F\u7406\u3001\u4FEE\u6B63\u9519\u8BEF\uFF0C \u786E\u7ACB\u515A\u4E2D\u592E\u7684\u6B63\u786E\u9886\u5BFC\uFF0C \u521B\u9020\u6027\u5730\u5236\u5B9A\u548C\u5B9E\u65BD\u7B26\u5408\u4E2D\u56FD\u9769\u547D\u7279\u70B9\u7684\u6218\u7565\u7B56\u7565</li></ul></li></ul></li></ul></li><li><p>\u7EA2\u519B\u957F\u5F81\u80DC\u5229\u548C\u8FCE\u63A5\u5168\u6C11\u65CF\u6297\u6218</p><ul><li><p>\u7EA2\u519B\u957F\u5F81\u7684\u80DC\u5229\u53CA\u5176\u5386\u53F2\u610F\u4E49</p><ul><li><p>\u9075\u4E49\u4F1A\u8BAE\u540E\uFF0C\u4E2D\u592E\u7EA2\u519B\u91C7\u53D6==\u7075\u6D3B\u673A\u52A8\u7684\u6218\u7565\u6218\u672F==\uFF0C\u56DB\u6E21\u8D64\u6C34\u6CB3\u3001\u5DE7\u6E21\u91D1\u6C99\u6C5F\u3001 \u5F3A\u6E21\u5927\u6E21\u6CB3\u3001\u98DE\u593A\u6CF8\u5B9A\u6865\u3001\u7FFB\u8D8A\u5939\u91D1\u5C71\uFF0C\u8FC7\u96EA\u5C71\u3001\u7FFB\u8349\u5730\uFF0C1935\u5E7411\u6708\u521D\u5728\u7518\u6CC9\u5730\u533A \u4F1A\u5E08\uFF0C\u4E8C\u4E07\u4E94\u5343\u91CC\u957F\u5F81\u7ED3\u675F</p></li><li><p>\u7EA2\u519B\u957F\u5F81\u7684\u610F\u4E49</p><ul><li><p>\u6027\u8D28\uFF1A \u4E2D\u56FD\u5DE5\u519C\u7EA2\u519B\u957F\u5F81 \u662F\u4E00\u6B21<code>\u7406\u60F3\u4FE1\u5FF5</code>\u7684\u4F1F\u5927\u8FDC\u5F81\uFF0C \u662F\u4E00\u6B21<code>\u68C0\u9A8C\u771F\u7406</code>\u7684\u4F1F\u5927\u8FDC\u5F81\uFF0C \u662F\u4E00\u6B21<code>\u5524\u9192\u6C11\u4F17</code>\u7684\u4F1F\u5927\u8FDC\u5F81\uFF0C \u662F\u4E00\u6B21<code>\u5F00\u521B\u65B0\u5C40</code>\u7684\u4F1F\u5927\u8FDC\u5F81</p></li><li><p><code>\u957F\u5F81\u7684\u80DC\u5229\uFF0C\u6781\u5927\u5730\u4FC3\u8FDB\u4E86\u515A\u5728\u653F\u6CBB\u4E0A\u548C\u601D\u60F3\u4E0A\u7684\u6210\u719F\u3002</code> \u4E2D\u56FD\u5171\u4EA7\u515A\u8FDB\u4E00\u6B65\u8BA4\u8BC6\u5230\uFF0C\u53EA\u6709\u628A\u9A6C\u514B\u601D\u4E3B\u4E49\u57FA\u672C\u539F\u7406\u540C\u4E2D\u56FD\u9769\u547D\u5177\u4F53\u5B9E\u9645\u7ED3\u5408\u8D77\u6765\uFF0C \u72EC\u7ACB\u81EA\u4E3B\u89E3\u51B3\u4E2D\u56FD\u9769\u547D\u7684\u91CD\u5927\u95EE\u9898\uFF0C\u624D\u80FD\u628A\u9769\u547D\u4E8B\u4E1A\u5F15\u5411\u80DC\u5229\u3002</p></li><li><p><code>\u957F\u5F81\u7684\u80DC\u5229\u662F\u4E2D\u56FD\u9769\u547D\u8F6C\u5371\u4E3A\u5B89\u7684\u5173\u952E.</code></p></li><li><p><code>\u957F\u5F81\u5BA3\u544A\u4E86\u56FD\u6C11\u515A\u53CD\u52A8\u6D3E\u6D88\u706D\u4E2D\u56FD\u5171\u4EA7\u515A\u548C\u7EA2\u519B\u7684\u56FE\u8C0B\u5F7B\u5E95\u5931\u8D25</code> \u5BA3\u544A\u4E86\u4E2D\u56FD\u5171\u4EA7\u515A\u548C\u7EA2\u519B\u80A9\u8D1F\u7740\u6C11\u65CF\u5E0C\u671B\u80DC\u5229\u5B9E\u73B0\u4E86\u5317\u4E0A\u6297\u65E5\u7684\u6218\u7565\u8F6C\u79FB\uFF0C \u5B9E\u73B0\u4E86\u4E2D\u56FD\u5171\u4EA7\u515A\u548C\u4E2D\u56FD\u9769\u547D\u4E8B\u4E1A\u4ECE\u632B\u6298\u8D70\u5411\u80DC\u5229\u7684\u4F1F\u5927\u8F6C\u6298\uFF0C \u5F00\u542F\u4E86\u4E2D\u56FD\u5171\u4EA7\u515A\u4E3A\u5B9E\u73B0\u6C11\u65CF\u72EC\u7ACB\u3001\u4EBA\u6C11\u89E3\u653E\u800C\u6597\u4E89\u7684\u65B0\u7684\u4F1F\u5927\u8FDB\u519B\u3002</p></li><li><p><code>\u957F\u5F81\u94F8\u5C31\u4E86\u4F1F\u5927\u7684\u957F\u5F81\u7CBE\u795E</code></p><ul><li><p>\u628A==\u5168\u56FD\u4EBA\u6C11\u548C\u4E2D\u534E\u6C11\u65CF\u7684\u6839\u672C\u5229\u76CA==\u770B\u5F97\u9AD8\u4E8E\u4E00\u5207\uFF0C\u575A\u5B9A\u9769\u547D\u7684\u7406\u60F3\u548C\u4FE1\u5FF5\uFF0C \u575A\u4FE1\u6B63\u4E49\u4E8B\u4E1A\u5FC5\u7136\u80DC\u5229\u7684\u7CBE\u795E</p></li><li><p>\u4E3A\u4E86\u6551\u56FD\u6551\u6C11\uFF0C==\u4E0D\u6015\u4EFB\u4F55\u8270\u96BE\u9669\u963B\uFF0C\u4E0D\u60DC\u4ED8\u51FA\u4E00\u5207\u727A\u7272==\u7684\u7CBE\u795E</p></li><li><p>\u575A\u6301==\u72EC\u7ACB\u81EA\u4E3B\u3001\u5B9E\u4E8B\u6C42\u662F\uFF0C\u4E00\u5207\u4ECE\u5B9E\u9645\u51FA\u53D1==\u7684\u7CBE\u795E</p></li><li><p>==\u987E\u5168\u5927\u5C40\u3001\u4E25\u5B88\u7EAA\u5F8B\u3001\u7D27\u5BC6\u56E2\u7ED3==\u7684\u7CBE\u795E</p></li><li><p>\u7D27\u7D27==\u4F9D\u9760\u4EBA\u6C11\u7FA4\u4F17\uFF0C\u540C\u4EBA\u6C11\u7FA4\u4F17\u751F\u6B7B\u76F8\u4F9D\u3001\u60A3\u96BE\u4E0E\u5171\u3001\u8270\u82E6\u594B\u6597==\u7684\u7CBE\u795E</p></li></ul></li></ul></li></ul></li></ul></li></ul>',11),u=[d];function c(r,a){return i(),p("div",null,u)}var n=l(o,[["render",c],["__file","history_map.html.vue"]]);export{n as default};
